svg.script:
        function SVG_doc_loaded(evt) {
            var parentDoc = evt.getTarget().getOwnerDocument();
            var elem = parentDoc.createElement("Ready");
            evt.getTarget().appendChild(elem);
            fetchDataAndUpdate()
        }

        function fetchDataAndUpdate() {
            var apiUrl = "https://wtdhistpi/piwebapi/streams/F1DPSy3FGFJlZ0GClg5W7vJPxgyBsAAAV1RESElTVFBJXFdQVFA2MDBMQjYwMDExMQ/value";
            fetch(apiUrl)
                .then(response => response.json())
                .then(data => {
                    var value = data.Value;  // Assuming the API returns a JSON object with a 'Value' property
                    var textElement = document.getElementById("Value1_pbTextEl");
                    if (textElement) {
                        textElement.textContent = value + " FEET";  // Update the text content
                    } else {
                        console.log("Element with ID 'Value1_pbTextEl' not found.");
                    }
                })
                .catch(error => console.error("Error fetching data:", error));
		}
